import React from "react";
import { useNavigate } from "react-router-dom";


const wellcomePage = () => {
  return (
    <div style={styles.container}>
      <header style={styles.header}>
        <h1 style={styles.logo}>YourBrand</h1>
        <nav style={styles.nav}>
          <a href="#about" style={styles.link}>About</a>
          <a href="#features" style={styles.link}>Features</a>
          <a href="#contact" style={styles.link}>Contact</a>
        </nav>
      </header>

      <section style={styles.hero}>
        <h1 style={styles.heroTitle}>Welcome to YourBrand</h1>
        <p style={styles.heroSubtitle}>
          Discover the best solutions tailored just for you.
        </p>
        <button style={styles.ctaButton}>Get Started</button>
      </section>

      <section id="about" style={styles.section}>
        <h2 style={styles.sectionTitle}>About Us</h2>
        <p style={styles.text}>
          YourBrand is dedicated to providing top-notch services to help you achieve your goals.
        </p>
      </section>

      <section id="features" style={styles.section}>
        <h2 style={styles.sectionTitle}>Features</h2>
        <div style={styles.features}>
          <div style={styles.feature}>
            <h3>Feature 1</h3>
            <p>High-quality services designed for your success.</p>
          </div>
          <div style={styles.feature}>
            <h3>Feature 2</h3>
            <p>Innovative solutions tailored to your needs.</p>
          </div>
          <div style={styles.feature}>
            <h3>Feature 3</h3>
            <p>24/7 support to ensure satisfaction.</p>
          </div>
        </div>
      </section>

      <footer style={styles.footer}>
        <p>&copy; 2024 YourBrand. All Rights Reserved.</p>
      </footer>
    </div>
  );
};

const styles = {
  container: {
    fontFamily: 'Arial, sans-serif',
    lineHeight: 1.6,
    color: '#333',
  },
  header: {
    display: 'flex',
    justifyContent: 'space-between',
    padding: '1rem 2rem',
    borderBottom: '1px solid #ddd',
  },
  logo: {
    fontSize: '1.5rem',
    fontWeight: 'bold',
  },
  nav: {
    display: 'flex',
    gap: '1rem',
  },
  link: {
    textDecoration: 'none',
    color: '#007bff',
  },
  hero: {
    textAlign: 'center',
    padding: '3rem 1rem',
    backgroundColor: '#f9f9f9',
  },
  heroTitle: {
    fontSize: '2.5rem',
    marginBottom: '1rem',
  },
  heroSubtitle: {
    fontSize: '1.25rem',
    marginBottom: '2rem',
  },
  ctaButton: {
    padding: '0.75rem 1.5rem',
    backgroundColor: '#007bff',
    color: '#fff',
    border: 'none',
    borderRadius: '0.5rem',
    cursor: 'pointer',
  },
  section: {
    padding: '2rem 1rem',
    textAlign: 'center',
  },
  sectionTitle: {
    fontSize: '2rem',
    marginBottom: '1rem',
  },
  text: {
    fontSize: '1rem',
    marginBottom: '1rem',
  },
  features: {
    display: 'flex',
    justifyContent: 'center',
    gap: '2rem',
    flexWrap: 'wrap',
  },
  feature: {
    maxWidth: '300px',
  },
  footer: {
    textAlign: 'center',
    padding: '1rem 0',
    borderTop: '1px solid #ddd',
    marginTop: '2rem',
  },
};

export default wellcomePage;
